    public static int lengthOfLongestSubstring(String s) {
        
        int subStrLen = 1;
        int result = 1;
        int length = s.length();
        HashSet set = null;
        
        if("".equals(s))
        	return 0;
        
        for(int i=0;i<length;i++){
        	if((length-1-i) < result)
            	break;
            char c = s.charAt(i);
            set = new HashSet();
            Boolean duplicate = set.add(c);
            if(duplicate == false){
            	break;
            }               
            subStrLen = 1;            
            for(int j=i+1;j<length;j++){
            	char character = s.charAt(j);
            	duplicate = set.add(character);
                if(duplicate == false){
                	System.out.println(s.substring(i, j));
                	break;
                }         	      
                else{
                    subStrLen++;
                }
            }
            if(subStrLen > result){                    	
                result = subStrLen;                                    
            }
        }
        
        return result;
    }
